INSERT INTO `sys_oper_log` VALUES ('247', '产品管理', '1', 'com.ruoyi.project.webmanage.product.controller.ProductController.addSave()', '1', 'admin', '后台管理系统', '/jssgyqysy/webmanage/product/add', '127.0.0.1', '内网IP', '{\"productTypeId\":[\"1\"],\"productName\":[\"12\"],\"imgUrl\":[\"\"],\"detail\":[\"<p class=\\\"MsoNormal\\\">\\r\\n\\t&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <b>2019</b><b>年在海一方社区封面宝宝</b>\\r\\n</p>\\r\\n<p class=\\\"MsoNormal\\\">\\r\\n\\t&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 作为连云港地区最大的互动性网络社区，在海一方社区已经拥有<span>70</span>余万注册会员，平均在线人数<span>10000</span>以上，是集房产、汽车、美食、旅行、亲子、公益、人才招聘、卖场等各门类生活元素的综合平台。在海一方公众号粉丝<span>15</span>万<span>+</span>。为全面展示在海一方社区会员宝宝快乐成长的幸福童年，展现在海一方社区会员宝宝健康向上、充满活力的崭新形象<span>,</span>社区特别举办<span>2019</span>年在海一方论坛封面宝宝，面向社会广泛征集参赛宝宝。<span><br />\\r\\n</span>一、组织机构<span><br />\\r\\n</span>主办单位：在海一方社区<span><br />\\r\\n</span>承办单位：米兰贝贝儿童摄影生活馆<span></span>\\r\\n</p>\\r\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent:24.0pt;\\\">\\r\\n\\t&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 蒙台梭利早教中心<span></span>\\r\\n</p>\\r\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent:24.0pt;\\\">\\r\\n\\t&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 中艺童星文化艺术中心<span></span>\\r\\n</p>\\r\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent:24.0pt;\\\">\\r\\n\\t&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 杨阳打击乐俱乐部<span></span>\\r\\n</p>\\r\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent:24.0pt;\\\">\\r\\n\\t&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 连云港万达玛酷机器人教育<span></span>\\r\\n</p>\\r\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent:24.0pt;\\\">\\r\\n\\t&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; AT 天赋大脑<span></span>\\r\\n</p>\\r\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent:24.0pt;\\\">\\r\\n\\t&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 简析吴知美学馆<span></span>\\r\\n</p>\\r\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent:24.0pt;\\\">\\r\\n\\t&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 云上跆拳道<span></span>\\r\\n</p>\\r\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent:24.0pt;\\\">\\r\\n\\t&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 亲子爱旅游（<span>1000</span>人微信群）<span></span>\\r\\n</p>\\r\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent:24.0pt;\\\">\\r\\n\\t&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 在海一方亲子俱乐部（<span>1000</span>人<span>QQ</span>群）<span></span>\\r\\n</p>\\r\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent:24.0pt;\\\">\\r\\n\\t&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 积木宝贝早教中心<span><br />\\r\\n</span>二、报名时间<span><br />\\r\\n</span>&emsp;&emsp;<span>2019</span>年<sp', '0', null, '2019-10-29 09:18:01');
