CREATE TABLE `t_hkws_camera` (
  `camera_id` int(11) NOT NULL AUTO_INCREMENT,
  `type` int(11) DEFAULT NULL COMMENT '1：进门人脸识别、2：出门人脸识别',
  `camera_index_codes` varchar(255) DEFAULT NULL COMMENT '相机识别编号（海康提供）',
