DROP TABLE IF EXISTS `t_user_binding`;
CREATE TABLE `t_user_binding` (
  `binding_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL COMMENT '用户ID',
  `yjbb_status` int(11) DEFAULT NULL COMMENT '饮酒报备绑定状态',
